import React from 'react';
import { Link } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Navbar = () => {
  return (
    <>
      {/* Navbar with background image */}
      <nav
        className="navbar navbar-expand-lg"
        style={{
          backgroundColor: '#011F60',
          backgroundImage: 'url(/images/p1.jpg)', // Background image
          backgroundSize: 'cover',
          backgroundPosition: 'center center',
          color: 'white',
        }}
      >
        <div className="container-fluid">
          {/* Brand Logo or Link */}
          <Link className="navbar-brand text-white" to="/shop">
            Arul Online Electromart
          </Link>

          {/* Navbar Menu */}
          

          {/* Search Form */}
          <form className="d-flex me-3">
            <input
              className="form-control me-2"
              type="search"
              placeholder="Search Products"
              aria-label="Search"
            />
            <button className="btn btn-light" type="submit">
              Search
            </button>
          </form>

          {/* Logout Button */}
          <button className="btn btn-danger" aria-label="Logout">
            Logout
          </button>
        </div>
      </nav>

      {/* Main Content Section */}
      <Container>
        <h1>Welcome to the Order Management System</h1>
        <nav className="d-flex justify-content-center">
          <Link to="/customerorder">
            <button className="btn btn-primary mb-3">Customer Order</button>
          </Link>
          <Link to="/adminorder">
            <button className="btn btn-secondary mb-3 ms-3">Admin Order</button>
          </Link>
        </nav>
      </Container>
    </>
  );
};

export default Navbar;
